import axios from 'axios'

function Index() {
    axios.get('http://localhost:8080').then(r => r.json()).then(r => {
        return (
            <div>
                {
                    {
                        "items": [
                            { "id": 1, "name": "Apples", "price": "$2" },
                            { "id": 2, "name": "Peaches", "price": "$5" }
                        ]
                    }
                }
            </div>
        )
    })
}

export default Index
